/*Table structure for table `computer` */

CREATE TABLE `computer` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Asset ID',
  `name` varchar(384) NOT NULL COMMENT 'Computer Name',
  `migration_status` varchar(385) DEFAULT NULL COMMENT 'Migration Status',
  `user_name` varchar(385) DEFAULT NULL COMMENT 'Description',
  `location` varchar(385) DEFAULT NULL COMMENT 'Location',
  `computer_type` varchar(385) DEFAULT NULL COMMENT 'Computer Type',
  `computer_model` varchar(385) DEFAULT NULL COMMENT 'Computer Model',
  `operating_system` varchar(385) DEFAULT NULL COMMENT 'Operating System',
  `windows_10_version` varchar(385) DEFAULT NULL COMMENT 'Windows 10 Version',
  `memory_gb` varchar(385) DEFAULT NULL COMMENT 'Memory (GB)',
  `disk_size_gb` varchar(385) DEFAULT NULL COMMENT 'Disk Size (GB)',
  `free_space_gb` varchar(256) DEFAULT NULL COMMENT 'Free Space (GB)',
  `serial` varchar(256) DEFAULT NULL COMMENT 'Serial Number',
  `business_unit` varchar(385) DEFAULT NULL COMMENT 'Business Unit',
  `department` varchar(385) DEFAULT NULL COMMENT 'Department',
  `replacement_ordered` enum('Yes','No','Not-Needed') DEFAULT NULL COMMENT 'HW Replacement Ordered',
  `static_ip` varchar(256) DEFAULT NULL COMMENT 'Static IP',
  `state` enum('In Stock','In Use') DEFAULT NULL COMMENT 'State',
  `central_build_site` varchar(385) DEFAULT NULL COMMENT 'Central Build Site',
  `last_logon_user` varchar(256) DEFAULT NULL COMMENT 'Last Logon User',
  `vetted` enum('NO','YES') DEFAULT NULL COMMENT 'Asset Vetted',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`),
  KEY `lu__migration_status` (`migration_status`),
  KEY `lu__location` (`location`),
  KEY `lu__computer_type` (`computer_type`),
  KEY `lu__computer_model` (`computer_model`),
  KEY `lu__operating_system` (`operating_system`),
  KEY `lu__windows_10_version` (`windows_10_version`),
  KEY `lu__business_unit` (`business_unit`),
  KEY `lu__department` (`department`),
  KEY `replacement_ordered` (`replacement_ordered`),
  KEY `lu__memory_gb` (`memory_gb`),
  KEY `lu__disk_size_gb` (`disk_size_gb`),
  KEY `state` (`state`),
  KEY `lu__central_build_site` (`central_build_site`)
) ENGINE=InnoDB AUTO_INCREMENT=1666 DEFAULT CHARSET=utf8;

